import React from "react";
import './bodySkills.css';
import ProgressBar from "./ProgressBar";



class bodyLanguages extends React.Component {
    render() {
        return (
            <div className={this.props.className}>
               <h1 id="skills" className="skills-header">Languages Skills</h1>
                <div className="container-splitter">
                    <div className="col-container">
                    <ProgressBar title="English" level="Upper-Intermediate" percent="60%"
                    />
                    <ProgressBar title="Romanian" level="Intermediate" percent="45%"/>
                    <ProgressBar title="JavaScript" level="Basic" percent="40%"/>
                    </div>

                    <div className="col-container">
                    <ProgressBar title="React-JS" level="Basic" percent="35%"/>
                    <ProgressBar title="HTTP-server" level="Basic" percent="35%"/>
                    <ProgressBar title="C++ / Java / C#" level="Basic" percent="30%"/>
                    </div>
                </div>
                
            </div>
        )


    }

}
 export default bodyLanguages;
